import React, {Component} from 'react';
import './App.css';
import EmailIcon from '@material-ui/icons/Email';
import PhoneIcon from '@material-ui/icons/Phone';
import LocationOnIcon from '@material-ui/icons/LocationOn';

class App extends Component {

  render (){
      return (
        <div>
          <h1 className='tc f1'>Joceline Yadira Mart√≠nez Vidal</h1>

            <div class="flex justify-center">
               <div class=" pa3">
                  <code><LocationOn fontSize='large'/></code>
              </div>
              <div class=" pa1">
                  <code><p className='f4'> Mexico City</p></code>
              </div>
              <div class=" pa3">
                  <code><EmailIcon fontSize='large'/></code>
              </div>
              <div class=" pa1 mr1">
                  <code><p className='f4'> jocelineyadira@hotmail.com</p></code>
              </div>
              <div class=" pa3">
                  <code><PhoneIcon fontSize='large'/></code>
              </div>
              <div class=" pa1">
                  <code><p className='f4'> 5541782362</p></code>
              </div>
            </div> 

        </div>
      ); //fin return
  }//fin render
}//fin App

export default App;

